import React, {Component} from 'react';
import students from '../mock-data/students.json';

class Grid extends Component {
    constructor(props) {
        super(props);

        this.state = {
            students: []
        }
      }

    render() {
        return (
            <div className = 'Grid'>
                {this.state.name}
            </div>
        )
      }
}
export default Grid;
